import React from 'react';
import { Link } from 'react-router-dom';
import './styles/'; // Assuming you place the CSS code in a file named Navbar.css

const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-md navbar-light bg-white shadow-lg">
            <div className="container-fluid">
                {/* Logo */}
                <Link className="navbar-brand text-gray-800 font-bold" to="/">BrandName</Link>

                {/* Mobile Menu Button */}
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                {/* Links */}
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav ms-auto mb-2 mb-md-0">
                        <li className="nav-item">
                            <Link className="nav-link" to="/">Home</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/features">Features</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/feedback">Healthcare</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/login">Login</Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
